    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #131722;
            color: #d1d4dc;
        }

        .container {
            width: 100%;
            height: 100vh;
            display: flex;
            flex-direction: column;
        }

        .header {
            padding: 12px 20px;
            background: #1e222d;
            border-bottom: 1px solid #2a2e39;
            display: flex;
            align-items: center;
            gap: 20px;
        }

        .header h1 {
            font-size: 16px;
            font-weight: 500;
            color: #d1d4dc;
        }

        .legend {
            display: flex;
            gap: 15px;
            font-size: 12px;
        }

        .legend-item {
            display: flex;
            align-items: center;
            gap: 5px;
        }

        .legend-color {
            width: 12px;
            height: 3px;
            border-radius: 1px;
        }

        #chart-container {
            flex: 1;
            width: 100%;
        }

        .ohlc-panel {
            position: absolute;
            top: 50px;
            left: 10px;
            padding: 8px 12px;
            background: rgba(30, 34, 45, 0.85);
            border-radius: 4px;
            font-size: 12px;
            z-index: 1000;
            pointer-events: none;
            display: flex;
            gap: 15px;
            align-items: center;
        }

        .ohlc-item {
            display: flex;
            gap: 4px;
        }

        .ohlc-label {
            color: #787b86;
        }

        .ohlc-value {
            font-weight: 500;
        }

        .ohlc-value.up {
            color: #26a69a;
        }

        .ohlc-value.down {
            color: #ef5350;
        }

        .ohlc-date {
            color: #d1d4dc;
            margin-right: 10px;
        }
    </style>
</head>

2.5978}, {"time": 1762905600, "value": 5362.5978}, {"time": 1762992000, "value": 5362.5978}, {"time": 1763078400, "value": 5362.5978}, {"time": 1763337600, "value": 5362.5978}, {"time": 1763424000, "value": 5362.5978}, {"time": 1763510400, "value": 5362.5978}, {"time": 1763596800, "value": 5362.5978}, {"time": 1763683200, "value": 5362.5978}, {"time": 1763942400, "value": 5362.5978}, {"time": 1764028800, "value": 5362.5978}, {"time": 1764115200, "value": 5362.5978}, {"time": 1764201600, "value": 5362.5978}, {"time": 1764288000, "value": 5362.5978}, {"time": 1764547200, "value": 5293.6267}, {"time": 1764633600, "value": 5293.6267}, {"time": 1764720000, "value": 5293.6267}, {"time": 1764806400, "value": 5293.6267}, {"time": 1764892800, "value": 5293.6267}, {"time": 1765152000, "value": 5293.6267}, {"time": 1765238400, "value": 5293.6267}, {"time": 1765324800, "value": 5293.6267}, {"time": 1765411200, "value": 5293.6267}, {"time": 1765497600, "value": 5293.6267}, {"time": 1765756800, "value": 5293.6267}, {"time": 1765843200, "value": 5293.6267}, {"time": 1765929600, "value": 5293.6267}, {"time": 1766016000, "value": 5293.6267}, {"time": 1766102400, "value": 5293.6267}, {"time": 1766361600, "value": 5293.6267}, {"time": 1766448000, "value": 5293.6267}, {"time": 1766534400, "value": 5293.6267}, {"time": 1766620800, "value": 5293.6267}, {"time": 1766707200, "value": 5293.6267}, {"time": 1766966400, "value": 5293.6267}, {"time": 1767052800, "value": 5293.6267}, {"time": 1767139200, "value": 5293.6267}], "color": "#66BB6A", "width": 1, "style": "Dashed", "title": "V2 Major Low"}]; // 接收通用线段数据

        // 创建图表
        const container = document.getElementById('chart-container');
        const chart = LightweightCharts.createChart(container, {
            layout: {
                background: { type: 'solid', color: '#131722' },
                textColor: '#d1d4dc',
            },
            grid: {
                vertLines: { color: '#1e222d' },
                horzLines: { color: '#1e222d' },
            },
            crosshair: {
                mode: LightweightCharts.CrosshairMode.Normal,
                vertLine: {
                    color: '#758696',
                    width: 1,
                    style: LightweightCharts.LineStyle.Dashed,
                    labelBackgroundColor: '#2a2e39',
                },
                horzLine: {
                    color: '#758696',
                    width: 1,
                    style: LightweightCharts.LineStyle.Dashed,
                    labelBackgroundColor: '#2a2e39',
                },
            },
            rightPriceScale: {
                borderColor: '#2a2e39',
                mode: LightweightCharts.PriceScaleMode.Logarithmic,
                scaleMargins: {
                    top: 0.1,
                    bottom: 0.1,
                },
            },
            timeScale: {
                borderColor: '#2a2e39',
                timeVisible: false,
                secondsVisible: false,
                rightOffset: 5,
                tickMarkFormatter: (time) => {
                    const date = new Date(time * 1000);
                    const yy = String(date.getFullYear()).slice(-2);
                    const mm = String(date.getMonth() + 1).padStart(2, '0');
                    const dd = String(date.getDate()).padStart(2, '0');
                    return `${yy}-${mm}-${dd}`;
                },
            },
            localization: {
                timeFormatter: (time) => {
                    const date = new Date(time * 1000);
                    const yy = String(date.getFullYear()).slice(-2);
                    const mm = String(date.getMonth() + 1).padStart(2, '0');
                    const dd = String(date.getDate()).padStart(2, '0');
                    return `${yy}-${mm}-${dd}`;
                },
            },
            handleScroll: {
                vertTouchDrag: false,
            },
            handleScale: {
                mouseWheel: false,
            },
        });

        // 自定义滚轮缩放：以鼠标位置为中心
        container.addEventListener('wheel', (e) => {
            e.preventDefault();

            const timeScale = chart.timeScale();
            const visibleRange = timeScale.getVisibleLogicalRange();
            if (!visibleRange) return;

            const containerRect = container.getBoundingClientRect();
            const mouseX = e.clientX - containerRect.left;
            const chartWidth = containerRect.width;

            const mouseRatio = mouseX / chartWidth;
            const rangeLength = visibleRange.to - visibleRange.from;
            const zoomFactor = e.deltaY > 0 ? 1.1 : 0.9;
            const newRangeLength = rangeLength * zoomFactor;

            if (newRangeLength < 10 || newRangeLength > candlestickData.length) return;

            const mouseLogicalPos = visibleRange.from + rangeLength * mouseRatio;
            const newFrom = mouseLogicalPos - newRangeLength * mouseRatio;
            const newTo = mouseLogicalPos + newRangeLength * (1 - mouseRatio);

            timeScale.setVisibleLogicalRange({
                from: newFrom,
                to: newTo,
            });
        }, { passive: false });

        // --------------------------------------------------------
        // Shift + 拖动: 垂直平移
        // --------------------------------------------------------
        let isDragging = false;
        let lastY = 0;
        let currentTopMargin = 0.1;
        let currentBottomMargin = 0.1;

        container.addEventListener('mousedown', (e) => {
            if (e.shiftKey) {
                isDragging = true;
                lastY = e.clientY;
                e.preventDefault();
            }
        });

        document.addEventListener('mousemove', (e) => {
            if (!isDragging) return;

            const deltaY = e.clientY - lastY;
            lastY = e.clientY;

            const marginDelta = deltaY / container.clientHeight * 0.5;
            currentTopMargin = Math.max(0, Math.min(0.9, currentTopMargin + marginDelta));
            currentBottomMargin = Math.max(0, Math.min(0.9, currentBottomMargin - marginDelta));

            chart.priceScale('right').applyOptions({
                scaleMargins: {
                    top: currentTopMargin,
                    bottom: currentBottomMargin,
                },
            });
        });

        document.addEventListener('mouseup', () => {
            isDragging = false;
        });

        // 双击重置视图
        container.addEventListener('dblclick', () => {
            currentTopMargin = 0.1;
            currentBottomMargin = 0.1;
            chart.priceScale('right').applyOptions({
                scaleMargins: {
                    top: 0.1,
                    bottom: 0.1,
                },
            });
            chart.timeScale().fitContent();
        });
        // --------------------------------------------------------


        // OHLC 蜡烛图系列
        const candlestickSeries = chart.addCandlestickSeries({
            upColor: '#26a69a',
            downColor: '#ef5350',
            borderUpColor: '#26a69a',
            borderDownColor: '#ef5350',
            wickUpColor: '#26a69a',
            wickDownColor: '#ef5350',
        });
        candlestickSeries.setData(candlestickData);

        // 设置标记 (Swing Points / 分型点)
        if (markersData.length > 0) {
            candlestickSeries.setMarkers(markersData);
        }

        // 添加通用线段 (如 Major High/Low 虚线)
        if (genericLinesData && genericLinesData.length > 0) {
            genericLinesData.forEach(line => {
                const lineSeries = chart.addLineSeries({
                    color: line.color,
                    lineWidth: line.width || 1,
                    lineStyle: line.style === 'Dashed' ? LightweightCharts.LineStyle.Dashed : LightweightCharts.LineStyle.Solid,
                    title: line.title || '',
                });
                lineSeries.setData(line.data);
            });
        }

        // 技术指标线
        const legendContainer = document.getElementById('legend');
        indicators.forEach((indicator, index) => {
            const lineSeries = chart.addLineSeries({

                color: indicator.color,
                lineWidth: indicator.lineWidth,
                crosshairMarkerVisible: true,
                lastValueVisible: false,
                priceLineVisible: false,
            });
            lineSeries.setData(indicator.data);

            const legendItem = document.createElement('div');
            legendItem.className = 'legend-item';
            legendItem.innerHTML = `
                <div class="legend-color" style="background: ${indicator.color}"></div>
                <span>${indicator.name}</span>
            `;
            legendContainer.appendChild(legendItem);
        });

        // 添加笔图例
        if (strokesData.length > 0) {
            const strokeLegend = document.createElement('div');
            strokeLegend.className = 'legend-item';
            strokeLegend.innerHTML = `
                <div class="legend-color" style="background: #9c27b0"></div>
                <span>笔</span>
            `;
            legendContainer.appendChild(strokeLegend);
        }

        // OHLC 面板
        const ohlcPanel = document.getElementById('ohlc-panel');

        chart.subscribeCrosshairMove((param) => {
            if (!param.time || !param.point) {
                ohlcPanel.innerHTML = '';
                return;
            }

            const data = param.seriesData.get(candlestickSeries);
            if (!data) {
                ohlcPanel.innerHTML = '';
                return;
            }

            const date = new Date(param.time * 1000);
            const dateStr = date.toISOString().split('T')[0];

            // 获取指标值
            let indicatorHtml = '';
            indicators.forEach((indicator) => {
                const found = indicator.data.find(d => d.time === param.time);
                if (found) {
                    indicatorHtml += `
                        <div class="ohlc-item">
                            <span class="ohlc-label">${indicator.name}:</span>
                            <span class="ohlc-value" style="color:${indicator.color}">${found.value.toFixed(pricePrecision)}</span>
                        </div>
                    `;
                }
            });

            const isUp = data.close >= data.open;
            const colorClass = isUp ? 'up' : 'down';

            ohlcPanel.innerHTML = `
                <span class="ohlc-date">${dateStr}</span>
                <div class="ohlc-item"><span class="ohlc-label">O:</span><span class="ohlc-value ${colorClass}">${data.open.toFixed(pricePrecision)}</span></div>
                <div class="ohlc-item"><span class="ohlc-label">H:</span><span class="ohlc-value ${colorClass}">${data.high.toFixed(pricePrecision)}</span></div>
                <div class="ohlc-item"><span class="ohlc-label">L:</span><span class="ohlc-value ${colorClass}">${data.low.toFixed(pricePrecision)}</span></div>
                <div class="ohlc-item"><span class="ohlc-label">C:</span><span class="ohlc-value ${colorClass}">${data.close.toFixed(pricePrecision)}</span></div>
                ${indicatorHtml}
            `;
        });

        // 自适应大小
        const resizeObserver = new ResizeObserver(entries => {
            for (const entry of entries) {
                chart.applyOptions({
                    width: entry.contentRect.width,
                    height: entry.contentRect.height,
                });
            }
        });
        resizeObserver.observe(container);

        // 初始显示最后 120 根 K 线
        if (candlestickData.length > 120) {
            const from = candlestickData[candlestickData.length - 120].time;
            const to = candlestickData[candlestickData.length - 1].time;
            chart.timeScale().setVisibleRange({ from, to });
        }

        // --------------------------------------------------------
        // 方向键导航 (带高亮标记)
        // --------------------------------------------------------
        let currentDataIndex = -1;
        let isKeyNavMode = false;  // 是否处于键盘导航模式

        // 鼠标移动时同步索引（但不覆盖标记）
        chart.subscribeCrosshairMove((param) => {
            if (param.time && !isKeyNavMode) {
                const idx = candlestickData.findIndex(d => d.time === param.time);
                if (idx !== -1) {
                    currentDataIndex = idx;
                }
            }
        });

        // 鼠标点击时退出键盘导航模式，清除标记
        container.addEventListener('click', () => {
            if (isKeyNavMode) {
                isKeyNavMode = false;
                candlestickSeries.setMarkers([]);  // 清除高亮标记
            }
        });

        function moveToCandleIndex(index) {
            if (index < 0 || index >= candlestickData.length) return;

            isKeyNavMode = true;
            currentDataIndex = index;
            const dataPoint = candlestickData[index];

            // 确保 K 线在可见区域内，如果不在则滚动到居中位置
            const visibleRange = chart.timeScale().getVisibleLogicalRange();
            if (visibleRange) {
                // 检查当前 K 线是否在可视范围外
                if (index < visibleRange.from + 5 || index > visibleRange.to - 5) {
                    const rangeLength = visibleRange.to - visibleRange.from;
                    const newFrom = index - rangeLength / 2;
                    const newTo = index + rangeLength / 2;
                    chart.timeScale().setVisibleLogicalRange({ from: newFrom, to: newTo });
                }
            }

            // 设置高亮标记（黄色圆点）
            candlestickSeries.setMarkers([{
                time: dataPoint.time,
                position: 'inBar',
                color: '#FFEB3B',
                shape: 'circle',
                size: 1.5,
            }]);

            const date = new Date(dataPoint.time * 1000);
            const dateStr = date.toISOString().split('T')[0];
            const isUp = dataPoint.close >= dataPoint.open;
            const colorClass = isUp ? 'up' : 'down';

            let indicatorHtml = '';
            indicators.forEach((indicator) => {
                const found = indicator.data.find(d => d.time === dataPoint.time);
                if (found) {
                    indicatorHtml += `
                        <div class="ohlc-item">
                            <span class="ohlc-label">${indicator.name}:</span>
                            <span class="ohlc-value" style="color:${indicator.color}">${found.value.toFixed(pricePrecision)}</span>
                        </div>
                    `;
                }
            });

            ohlcPanel.innerHTML = `
                <span class="ohlc-date">${dateStr}</span>
                <div class="ohlc-item"><span class="ohlc-label">O:</span><span class="ohlc-value ${colorClass}">${dataPoint.open.toFixed(pricePrecision)}</span></div>
                <div class="ohlc-item"><span class="ohlc-label">H:</span><span class="ohlc-value ${colorClass}">${dataPoint.high.toFixed(pricePrecision)}</span></div>
                <div class="ohlc-item"><span class="ohlc-label">L:</span><span class="ohlc-value ${colorClass}">${dataPoint.low.toFixed(pricePrecision)}</span></div>
                <div class="ohlc-item"><span class="ohlc-label">C:</span><span class="ohlc-value ${colorClass}">${dataPoint.close.toFixed(pricePrecision)}</span></div>
                <span style="color:#FFEB3B; font-size:11px;">●</span>
                ${indicatorHtml}
            `;
        }

        document.addEventListener('keydown', (e) => {
            if (e.key === 'ArrowLeft') {
                e.preventDefault();
                if (currentDataIndex === -1) {
                    currentDataIndex = candlestickData.length - 1;
                } else if (currentDataIndex > 0) {
                    currentDataIndex--;
                }
                moveToCandleIndex(currentDataIndex);
            } else if (e.key === 'ArrowRight') {
                e.preventDefault();
                if (currentDataIndex === -1) {
                    currentDataIndex = 0;
                } else if (currentDataIndex < candlestickData.length - 1) {
                    currentDataIndex++;
                }
                moveToCandleIndex(currentDataIndex);
            } else if (e.key === 'Escape') {
                // ESC 退出键盘导航模式
                isKeyNavMode = false;
                candlestickSeries.setMarkers([]);
            }
        });
    </script>
